import React, { useEffect, useState } from "react";
import axios from "axios";

const withArticlesData = (Component) => {
  return (props) => {
    const [articles, setArticles] = useState([]);

    useEffect(() => {
      axios.get("/api/articles") // Update with your actual API endpoint
        .then((response) => setArticles(response.data))
        .catch((error) => console.error("Error fetching articles:", error));
    }, []);

    return <Component {...props} articles={articles} />;
  };
};

function Articles({ articles = [] }) {
  return (
    <div>
      <h1>Articles List</h1>
      <ul>
        {articles.map((article, index) => (
          <li key={index}>{article.title}</li> // Assuming article has a title
        ))}
      </ul>
    </div>
  );
}

export default withArticlesData(Articles);
